import React ,{ useEffect, useState, Component } from 'react'
import { Link } from 'react-router-dom';
import { Nav, Navbar,NavDropdown,Container} from 'react-bootstrap';

import { NavbarBrand, NavbarToggler, Collapse, NavItem, Jumbotron,
  Button, Modal, ModalHeader, ModalBody,
    Form, FormGroup, Input, Label } from 'reactstrap';
    import {
        BrowserRouter as Router,
        Switch,
        Route,
        Redirect,
      } from "react-router-dom";
import axios from 'axios';
import { useHistory } from 'react-router-dom';

const Navbard = () => {
    const history = useHistory();

    const Logout = async () => {
        try {
            await axios.delete('http://localhost:5000/logout');
            history.push("/");
        } catch (error) {
            console.log(error);
        }
    }

    return (
        <nav className="navbar is-light" role="navigation" aria-label="main navigation">
            <div className="container">
            <Container>

     <Navbar.Toggle aria-controls="basic-navbar-nav" />
     <Navbar.Collapse id="basic-navbar-nav">
       <Nav className="me-auto">
       <Nav.Link href=""><h7 className="linkText">Home</h7></Nav.Link>
       <Nav.Link href=""><h7 className="linkText">Discover</h7></Nav.Link>
       <Nav.Link href="" ><h7 className="linkText">View Map</h7></Nav.Link>
       <Nav.Link href=""><h7 className="linkText">Planner</h7></Nav.Link>

       </Nav>


     </Navbar.Collapse>

   </Container>

                <div id="navbarBasicExample" className="navbar-menu">
                    <div className="navbar-start">
                        <a href="/" className="navbar-item">
                            Home
                        </a>
                    </div>

                    <div className="navbar-end">
                        <div className="navbar-item">
                            <div className="buttons">
                                <button onClick={Logout} className="button is-light">
                                    Log Out
                                </button>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </nav>
    )
}

export default Navbard
